    <section className="navigation">
      <div className="nav-container">
        <div className="brand">
          <img src={logo}></img>
        </div>
        <nav>
          <ul className="nav-list">
            <li>
              <a href="#!" onMouseEnter={onEnter} onMouseLeave={onLeave}>
                Home
              </a>
            </li>
            <li>
              <a href="#!" onMouseEnter={onEnter} onMouseLeave={onLeave}>
                About
              </a>
            </li>
            <li></li>
            <li>
              <a href="#!" onMouseEnter={onEnter} onMouseLeave={onLeave}>
                Showcase
              </a>
            </li>
            <li>
              <a href="#!" onMouseEnter={onEnter} onMouseLeave={onLeave}>
                Contact
              </a>
            </li>
          </ul>
        </nav>
      </div>
    </section>
  );
};

export default Header;
